import * as React from 'react';
import { Navigator, View, Button, Text, StyleSheet, TextInput, Image } from 'react-native';
import { signOut} from './controller/user-management/Firebase_Helper'
import auth from '@react-native-firebase/auth';

function MainScreen ({ navigation: { navigate } }) {
    const user = auth().currentUser;
    return (
        <View>
            <Text>Main Screen {user.emmail}</Text>
            <Button 
            title = 'Sign Out'
            onPress={() => 
            navigate('Login')}
            >  </Button>
        </View>
    );
  }

export default MainScreen;
